import React from 'react';
import './navbar.css';
import { NavLink } from "react-router-dom";
    
const Nav = () => {
    return (
      <div>
          <nav>
            <h3>Logo</h3>
            <ul>
            <li>About</li>
            <li>Distributions</li>
            </ul>

        </nav>
        </div>
        
    )
}

export default Nav;
